import { useCallback, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './RegistroCoder.css';
import muneno1 from './muñeco1.png';

const RegistroCoder = () => {
    const [numeroCelular, setNumeroCelular] = useState('');
    const [nombreCompleto, setNombreCompleto] = useState('');
    const [edad, setEdad] = useState('');
    const [contrasena, setContrasena] = useState('');
    const [error, setError] = useState('');
    const navigate = useNavigate(); // Navegación para redirigir después del registro

    const onYaTienesUnaClick = useCallback(() => {
        // Agrega tu código aquí si necesitas lógica adicional
    }, []);

    const handleSubmit = async (event) => {
        event.preventDefault(); // Evitar la recarga de la página

        if (!numeroCelular || !nombreCompleto || !edad || !contrasena) {
            setError('Por favor, rellena todos los campos.');
        } else {
            setError('');
            // Intentar registrarse
            try {
                const response = await fetch('http://localhost:5000/register', {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                    },
                    body: JSON.stringify({
                        username: nombreCompleto, // Almacena el nombre completo como nombre de usuario
                        email: numeroCelular,
                        password: contrasena,
                    }),
                });
                
                if (!response.ok) {
                    throw new Error('Error en el registro');
                }

                const data = await response.json();
                console.log(data); // Aquí puedes manejar la respuesta

                // Guardar el nombre de usuario en localStorage
                localStorage.setItem('username', nombreCompleto);

                navigate('/'); // Redirigir después de registrarse
            } catch (error) {
                setError('Error al registrarse: ' + error.message);
            }
        }
    };

    return (
        <div className="registrocoder">
            <div className="registro-del-coder-parent">
                <div className="registro-del-coder">Registro del Coder</div>
                <form onSubmit={handleSubmit}>
                    <div className="email">
                        <div className="correo-celular-wrapper">
                            <div className="correo-celular">Número de celular</div>
                        </div>
                        <input 
                            type="text" 
                            className="escribirlo" 
                            value={numeroCelular}
                            onChange={(e) => setNumeroCelular(e.target.value)}
                        />
                    </div>
                    <div className="email">
                        <div className="correo-celular-wrapper">
                            <div className="correo-celular">Nombre completo</div>
                        </div>
                        <input 
                            type="text" 
                            className="escribirlo" 
                            value={nombreCompleto}
                            onChange={(e) => setNombreCompleto(e.target.value)}
                        />
                    </div>
                    <div className="email">
                        <div className="correo-celular-wrapper">
                            <div className="correo-celular">Edad</div>
                        </div>
                        <select 
                            className="escribirlo"
                            value={edad}
                            onChange={(e) => setEdad(e.target.value)}
                        >
                            <option value="">Seleccione edad</option>
                            {Array.from({ length: 100 }, (_, i) => (
                                <option key={i} value={i + 1}>{i + 1}</option>
                            ))}
                        </select>
                    </div>
                    <div className="contrasea">
                        <div className="correo-celular-wrapper">
                            <div className="correo-celular">Contraseña</div>
                            <div className="ocultar">
                                <div className="ojo" />
                                <div className="ocultar1" />
                            </div>
                        </div>
                        <input 
                            type="password" 
                            className="escribirlo" 
                            value={contrasena}
                            onChange={(e) => setContrasena(e.target.value)}
                        />
                    </div>
                    {error && <div className="error-message">{error}</div>}
                    <button className="boton" type="submit">
                        Registrarse
                    </button>
                </form>
                <div className="extra-options">
                    <label className="remember-me">
                        <input type="checkbox" />
                        Recordarme
                    </label>
                </div>
                <div className="ayudaaa">
                    <a href="#" className="help-link">¿Necesitas ayuda?</a>
                </div>
            </div>
            <div className="ya-tienes-una-container" onClick={onYaTienesUnaClick}>
                <span>{`¿Ya tienes una cuenta? `}</span>
                <Link to="/iniciarsecion" className="iniciar-sesion">
                    Iniciar sesión
                </Link>
            </div>
            <img className="mueco1-icon" alt="" src={muneno1} />
        </div>
    );
};

export default RegistroCoder;
